import React from "react";
import { Link } from "react-router-dom";

const Header = () =>{
    return(
        <>
         <header className="header">
         <h3 className="headerx primary "><Link to="/">PT.</Link></h3>
             <nav className="navbar">
               <ul className="list">
               <Link className="navl" to="/Project">Project</Link>
               <Link className="navl" to ="/Skill">Skill</Link>
               <Link className="navl" to="/contact">Contact</Link>
               </ul>
               
             </nav>
         </header>   
        </>
    );
}

export default Header;
